struct TRegistro{ //Registros
    int chave; //chave do registro
    int *campos; //campos inteiros
};

struct TBucket{
    int profLocal; //profundidade local
    TRegistro *vetR;     //vetor contendo os registros do bucket
    int qtdElementos; //quantidade de elementos no bucket
};

struct TCelula{
    TBucket *ponteiro; //ponteiro para um bucket específico
    TCelula *proximo;
};

struct TLista{ //estrutura padrão de uma lista encadeada
    TCelula *primeiro;
    TCelula *ultimo;
};

struct TDir{ //diretório do índice do hash
    int profGlobal; //profundidade global
    int numReg,tamDir; //numero de campos inteiros que os registros terão
    int tamBuckets; //quantidade de registros contidos nos buckets
    TLista apontadores; //lista em vez de vetor, porque o diretório sempre que preciso ele está dobrando o seu tamanho
    //o binário que o ponteiro representa é intuitivo. Como ele é ordem, da pra saber qual bit cada um representa
};

TBucket *iniciaBucket(int p, int tb, int tc){ //p é a profundidade local, tb o tamanho do bucket, tc é o número de campos inteiros que o registro terá
    TBucket *genericBucket= new TBucket;
    genericBucket->vetR=new TRegistro[tb]; //colocando o tamanho do buckets
    for(int i=0;i<tb;i++){
        genericBucket->vetR[i].campos= new int[tc]; //incluindo os campos inteiros no registro
    }
    genericBucket->profLocal=p;
    genericBucket->qtdElementos=0;
    return genericBucket;
}

void criarLista(TLista &l){ //cria a lista de ponteiros do diretório
    l.primeiro = new TCelula;
    l.ultimo = l.primeiro;
    l.primeiro->proximo = NULL;
}

void inserirPonteiro(TBucket *x, TLista &l){ //Insere novo ponteiro na lista do diretório
    //é utilizada apenas pela função "incrementaProfGlobal
    l.ultimo->proximo = new TCelula;
    l.ultimo = l.ultimo->proximo;
    l.ultimo->ponteiro = x;
    l.ultimo->proximo = NULL;
}

void iniciaDiretorio(TDir &dir, int tb, int tc){ //tb é o tamanho do bucket
    dir.profGlobal=1; //profundidade mínima para índice hash funcionar
    dir.tamBuckets=tb;
    dir.numReg=tc;
    dir.tamDir=0;
    TBucket *A=iniciaBucket(dir.profGlobal,tb,tc); //criando os únicos 2 buckets para um profundidade global de 1
    TBucket *B=iniciaBucket(dir.profGlobal,tb,tc);
    criarLista(dir.apontadores);
    inserirPonteiro(A,dir.apontadores); //apontando os dois primeiros ponteiros do diretório para os buckets
    inserirPonteiro(B,dir.apontadores);
}

void incrementaProfGlobal(TDir &dir){ //dobrando os ponteiros de diretório
    int novosPonteiros; //quantidade de novos ponteiros que o diretórios terá
    novosPonteiros= pow(2,dir.profGlobal);
    TCelula *aux=dir.apontadores.primeiro->proximo;
    for(int i=0;i<novosPonteiros;i++){
        inserirPonteiro(aux->ponteiro,dir.apontadores);
        aux=aux->proximo;
    }
    dir.profGlobal++;

}

bool* H(int k, int n){ //função hash, pega o número em decimal e pega os n últimos dígitos binários
    int resto; //resto da divisão
    int digitos=0;
    while(pow(2,digitos)<=k) //calculando quantos digitos totais a variável tem
        digitos++;
    bool val[digitos];
    bool *valFinal=new bool[n];
    int j;
    for(j=digitos-1;j>=0;j--){
        resto = k % 2;
        k /=  2;
        if(resto==1)
            val[j]=true;
        else
            val[j]=false;
    }
    int cont=digitos-n;
    for(j=0;j<n;j++){
        if(cont<0) //condição caso o binário tem menos casas que foi pedido
            valFinal[j]=false;
        else
            valFinal[j]=val[cont];
        cont++;
    }
    return valFinal;

}

int HR(bool *a, int digitos){ //função contrária da hash, pega o binário e passa pra decimal, servirá pra achar a posição do ponteiro na lista
    int valDecimal=0; //variável de retorno
    int cont=digitos-1; //variável contadora
    for(int i=0;i<digitos;i++){
        if(a[i]==true)
            valDecimal+=pow(2,cont);
        cont--;
    }
    return valDecimal;
}

TBucket *achaBucket(int k, TDir d){ // dado uma chave de registro, acha o seu devido bucket que deve ser adicionado
    //essa função é utilizada para adicionar um novo elemento no bucket
    bool *bin=H(k,d.profGlobal); //achando as ultimas casa binárias o número representa
    int posicao = HR(bin,d.profGlobal); // acha a posição do apontador na lista
    //cout<<k<<"="<<posicao<<"na profGlobal"<<d.profGlobal<<endl;
    TCelula *aux=d.apontadores.primeiro->proximo;
    for (int i=0;i<posicao;i++){
        aux=aux->proximo;
    }
    return aux->ponteiro ;
}

TCelula *achaCelula(int k, TDir d){// dado um número, acha o seu devido bucket que deve ser adicionado
    // essa função é utilizada quando o apontador precisa mudar de bucket
    bool *bin=H(k,d.profGlobal); //achando as ultimas casa binárias o número representa
    int posicao = HR(bin,d.profGlobal); // acha a posição do apontador na lista
    TCelula *aux=d.apontadores.primeiro->proximo;
    for (int i=0;i<posicao;i++){
        aux=aux->proximo; //percorrendo a lista para achar a celula
    }
    return aux ;
}

void realocaVetor(TBucket *b,int p){ //quando uma chave sai do bucket, o vetor pode ficar com buracos, então a função serve para evitar isso
    for(int i=p;i<b->qtdElementos-1;i++){
        b->vetR[i]=b->vetR[i+1];
    }
    b->qtdElementos--;
}

void remover(int k,TDir &d){ //remove registro do bucket, caso ele exista
    TBucket *b;
    bool achou=false; //flag para detectar se o número foi encontrado
    b=achaBucket(k,d);
    for(int i=0;i<b->qtdElementos;i++){
        if(b->vetR[i].chave==k){

            realocaVetor(b,i);
            achou=true;
            break;
        }
    }
    /*if(achou==false)
        cout<<"O registro "<<k<<" não foi removido, chave não encontrada!"<<endl;
    else
        cout<<"Registro "<<k<<" removido com sucesso!"<<endl;*/
}

void separaBucket(TDir &d, TBucket *b){ //o bucket será separado em 2, os dois terão uma profundidade local incrementada


    bool *bin;
    int indB; //posição do bucket b na lista do diretório
    bin=H(b->vetR[0].chave,b->profLocal); //podia ser qualquer elemento da lista em vez do vetR[0].chave
    indB=HR(bin,b->profLocal);
    TCelula *aux=achaCelula(indB,d);
    b->profLocal++;
    TBucket *novo=iniciaBucket(b->profLocal,d.tamBuckets,d.numReg);
    int indSoma=pow(2,b->profLocal-1); //quantidade de casas pular para chegar na posição do ponteiro para o novo bucket
    for(int i=0;i<indSoma;i++){
        aux=aux->proximo;
    }
    int indNovo=indB+indSoma; //variável que pega a posição do bucket novo na lista do diretório
    aux->ponteiro=novo;
    int varAux; //essa variável auxiliar ajudará a colocar os registros nos seus devidos lugares após a separação do bucket
    int indices[d.tamBuckets];//vetor contendo índices do bucket b que será removido após ser transferido para o novo bucket
    int contIndices=0; //contador
    for(int i=0;i<d.tamBuckets;i++){ //percorre o bucket
        bin=H(b->vetR[i].chave,b->profLocal); //bin pega os n ultimos bits do registro do bucket B, índice i

        varAux=HR(bin,b->profLocal); //transforma esse binário em decimal de novo

        if(varAux==indNovo){ //verificando se esse registro irá para o novo bucket, ou manterá no bucket antigo

            novo->vetR[novo->qtdElementos]=b->vetR[i];//mandando o registro para o novo bucket
            novo->qtdElementos++;
            indices[contIndices]=i;
            contIndices++;

        }else{
            if(varAux==indB){
                //não faz nada, ele está mantido no bucket antigo
            }else{
                cout<<"ALGUMA COISA DEU ERRADO"<< i <<endl; //a chave de registro não pertence a nenhum dos buckets separados
                cout<<"varAux= "<<varAux<<endl;
                cout<<"indNovo= "<<indNovo<<endl;
                cout<<"indB= "<<indB<<endl;
            }
        }

    }
    for(int i=0;i<contIndices;i++){ //removendo os registros que não pertencem mais ao bucket b
        //cout<<"removendo vetR->chave["<<i<<"]= "<<b->vetR[i].chave<<endl;
        realocaVetor(b,indices[i]-i); //-i porque ele realocou i vezes, mudando o seu índice comparado a antes de realocar
    }
    int indMax=pow(2,d.profGlobal);
    int indNovoo=indNovo+indSoma;
    while(indNovoo<=indMax){
        for(int i=0;i<indSoma;i++){
            aux=aux->proximo;
        }
        bin=H(indNovoo,b->profLocal);
        if(HR(bin,b->profLocal)==indNovo)
            aux->ponteiro=novo;
        indNovoo=indNovoo+indSoma;
    }

}

void insereRegistro(int k, TDir &d){ //k: chave a ser inserida
    TBucket *b;
    b=achaBucket(k,d);
    if(d.tamBuckets==b->qtdElementos){ //o bucket está cheio?
        if(d.profGlobal==b->profLocal) //profundidade local desse bucket é igual a profundidade global do diretório?
            incrementaProfGlobal(d);
        separaBucket(d,b);
        insereRegistro(k,d);


    }else{ //insere normalmente no bucket
        b->vetR[b->qtdElementos].chave=k;
        b->qtdElementos++;
    }
}

void inserir(int k,int a1,int a2,int a3,int a4,int a5,int a6,int a7,TDir &d){ //k: chave a ser inserida
    d.tamDir++;
    TRegistro r;
    r.campos=new int[d.numReg];
    r.chave=k;
    r.campos[0]=a1;
    r.campos[1]=a2;
    r.campos[2]=a3;
    r.campos[3]=a4;
    r.campos[4]=a5;
    r.campos[5]=a6;
    r.campos[6]=a7;
    TBucket *b;
    b=achaBucket(r.chave,d);

    if(d.tamBuckets<=b->qtdElementos){//o bucket está cheio?
        if(d.profGlobal==b->profLocal) //profundidade local desse bucket é igual a profundidade global do diretório?
            incrementaProfGlobal(d);
        separaBucket(d,b);
        inserir(k,a1,a2,a3,a4,a5,a6,a7,d);


    }else{ //insere normalmente no bucket
        b->vetR[b->qtdElementos]=r;
        b->qtdElementos++;
        //cout<<"Inserindo registro "<<k<<" ... "<<endl;
    }
}

void inserir(int k,int a1,TDir &d){ //k: chave a ser inserida
    d.tamDir++;
    TRegistro r;
    r.campos=new int[d.numReg];
    r.chave=k;
    r.campos[0]=a1;
    TBucket *b;
    b=achaBucket(r.chave,d);

    if(d.tamBuckets<=b->qtdElementos){//o bucket está cheio?
        if(d.profGlobal==b->profLocal) //profundidade local desse bucket é igual a profundidade global do diretório?
            incrementaProfGlobal(d);
        separaBucket(d,b);
        inserir(k,a1,d);


    }else{ //insere normalmente no bucket
        b->vetR[b->qtdElementos]=r;
        b->qtdElementos++;
        //cout<<"Inserindo registro "<<k<<" ... "<<endl;
    }
}


