void buscaPorIgualdade(int k,TDir d){
    TBucket *b=achaBucket(k,d);
    bool achou=false;
    TRegistro r;
    for(int i=0;i<b->qtdElementos;i++){ //percorrendo seu devido bucket para procurar se a chave está lá
        if(k==b->vetR[i].chave){
            achou=true;
            r=b->vetR[i];
            break;
        }
    }
    if(achou==true){
        cout<<"O registro foi encontrado no bucket: [";
        for (int i=0;i<b->qtdElementos;i++){ //imprimindo bucket que a chave está contida
            if(i==b->qtdElementos-1)
                cout<<b->vetR[i].chave<<"*";
            else
                cout<<b->vetR[i].chave<<"*, ";
        }
        cout<<"]"<<endl;
        cout<<"Registro chave "<<k<<":"<<endl;
        for (int i=0;i<d.numReg;i++){
            cout<<"Campo "<<i+1<<": "<<r.campos[i]<<endl;
        }
    }else{
        cout<<"Registro não encontrado!"<<endl;
    }
}

